import React, { Component } from 'react';

import ButtonAdmin from '../../componentes/MenuButton/ButtonMenu';
import AppBar from '../../componentes/NavBar/NavBar';
import classes from './AdminMenu.css'

import {
    Link
} from "react-router-dom";


class AdminMenu extends Component {

    render() {
        return (
            <div>
           <AppBar/>
            <div className={classes['buttons']}>
                <Link to="/AdminResidentes">
                    <ButtonAdmin className={classes['button']} title='Residentes' logo='https://www.vhv.rs/dpng/d/217-2174722_admin-icon-png-transparent-png.png'></ButtonAdmin>
                </Link>
                <Link>
                    <ButtonAdmin className={classes['button']} title='Pago Administracion' logo='https://www.vhv.rs/dpng/d/217-2174722_admin-icon-png-transparent-png.png'></ButtonAdmin>
                </Link>
                <Link>
                    <ButtonAdmin className={classes['button']} title='Registro Visitante' logo='https://www.vhv.rs/dpng/d/217-2174722_admin-icon-png-transparent-png.png'></ButtonAdmin>
                </Link>
                <Link>
                    <ButtonAdmin className={classes['button']} title='Celadores' logo='https://www.vhv.rs/dpng/d/217-2174722_admin-icon-png-transparent-png.png'></ButtonAdmin>
                </Link>
            </div>
            </div>
        )
    }
}

export default AdminMenu
